// rafce -> shortcut
import React, { useState } from 'react'
import logo from './imgs/logo.png'
import { Squash as Hamburger } from 'hamburger-react'
import NavBarOpenLoggedIn from './NavBarOpenLoggedIn'
import { Link } from 'react-router-dom'
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import axios from 'axios';
import {useHistory} from 'react-router-dom'
import DropDownMenu from '../components/DropDownMenu'

const StyledMenu = withStyles({
  paper: {
    border: '1px solid 9c1a1a',
    background: '#171717',
    color: 'white',
  },
  
})((props) => (
  <Menu
    elevation={0}
    getContentAnchorEl={null}
    anchorOrigin={{
      vertical: 'bottom',
      horizontal: 'center',
    }}
    transformOrigin={{
      vertical: 'top',
      horizontal: 'center',
    }}
    {...props}
  />
));

const StyledMenuItem = withStyles((theme) => ({
  root: {
    '&:focus': {
      backgroundColor: "#9c1a1a",
      '& .MuiListItemIcon-root, & .MuiListItemText-primary': {
        color: "white",
      },
    },
  },
}))(MenuItem);


const StyledButton = withStyles({
  root: {
    background: '171717',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 48,
    padding: '0 20px',
   // boxShadow: '0 3px 5px 2px rgba(255, 255, 255, .3)',
    margin: "10px 0px 0px 0px",
    fontSize: '20px',
  },
  label: {
    textTransform: 'capitalize',
  },
})(Button);






const NavbarLoggedin = () => {


  









  const kereszt_nev = localStorage.getItem('k_nev');

  const [isOpen, setOpen] = useState(false);

  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };
  

  const history = useHistory();



  const logoutSubmit = (e) => {

    e.preventDefault();
    

    axios.get('/sanctum/csrf-cookie').then(response => {
    axios.post(`/api/logout`).then(res=>{

      if(res.data.status === 200)
      {
          localStorage.removeItem('auth_token');
          localStorage.removeItem('auth_name');               
          localStorage.removeItem('phone');
          localStorage.removeItem('v_nev');
          localStorage.removeItem('k_nev');
                   
          history.push('/');
          window.location.reload(false);

      }

    })

   });
  } 













    

  return (
    <div>
      <nav className="navbar">
        <img src={logo} alt="" className="logo" />
        <ul className="nav-links">
          <li>
            <Link to="/kolcsonzes">Autókölcsönzés</Link>
          </li>

          <li>
            <Link to="/modelljeink">Modelljeink</Link>
          </li>
          <li>
            <Link to="/rolunk">Rólunk</Link>
          </li>
          <li>
            <Link to="/ajandekbolt">Hűségprogram</Link>
          </li>
         
            <DropDownMenu />


            </ul>





  
              {/* <StyledButton
              aria-controls="customized-menu"
              aria-haspopup="true"
              color="inherit"
              onClick={handleClick}>
              {kereszt_nev} ⏷
            </StyledButton>
   
        <StyledMenu
        id="customized-menu"
        anchorEl={anchorEl}
        keepMounted
        open={Boolean(anchorEl)}
        onClose={handleClose}>

        <StyledMenuItem>
          <StyledButton
              aria-controls="customized-menu"
              aria-haspopup="true"
              color="inherit"
            >
              Kölcsönzéseim
            </StyledButton>
        </StyledMenuItem>
        <StyledMenuItem>
                    <StyledButton
              aria-controls="customized-menu"
              aria-haspopup="true"
              color="inherit"
              onClick={logoutSubmit}
            >
              Kijelentkezés
            </StyledButton>
        </StyledMenuItem>
        </StyledMenu> */}









        
       
        <Hamburger toggled={isOpen} toggle={setOpen} />
      </nav>
      {isOpen ? <NavBarOpenLoggedIn /> : <navbar />}
    </div>
  )
}

export default NavbarLoggedin
